import AuthForm from "../components/AuthForm";

function AuthenticationPage() {
  return <AuthForm />;
}

export const action = async ({ request }) => {
  console.log(request);

  fetch("http://localhost:8080/signup", {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({}),
  });
};

export default AuthenticationPage;
